import DUMMY_MEALS from "../../meals.js";
import classes from "./AvailableMeals.module.css";

export default function AvailbleMeals() {
  const mealList = DUMMY_MEALS.map((meal) => <li>{meal.name}</li>);
  return (
    <section className={classes.meal}>
      <ul>{mealList}</ul>
    </section>
  );
}
